/* empty css                  *//* empty css                                */const l=()=>{const a=document.querySelector("[data-tab-nav]");if(a){const c=document.querySelectorAll("[data-tab-btn]"),o=document.querySelectorAll("[data-tab-panel]");a.addEventListener("click",r=>{const e=r.target.closest("[data-tab-btn]");if(!e)return;const s=e.dataset.tabBtn??"",n=document.getElementById(s);c.forEach(t=>t.classList.toggle("isActive",t===e)),o.forEach(t=>t.classList.toggle("isActive",t===n))})}};l();
